import React from "react";
import { useSelector } from "react-redux";

const Cart = () => {
  const cart = useSelector((state) => state.cart)
  return(
    <>
       {cart.map((product)=>{
          return <h1>{product.title}</h1>
       })}
    </>
  );
};

export default Cart;
